// Fungsi untuk menyalin teks dari elemen <pre>
function copyText(elementId) {
  // Temukan elemen <pre> berdasarkan ID
  var element = document.getElementById(elementId);

  // Buat seleksi teks di dalam elemen <pre>
  var selection = window.getSelection();
  var range = document.createRange();
  range.selectNodeContents(element);
  selection.removeAllRanges();
  selection.addRange(range);

  // Salin teks yang dipilih
  document.execCommand('copy');

  // Kosongkan seleksi teks
  selection.removeAllRanges();
}

// Tambahkan event listener untuk tombol "Copy"
document.querySelector('.doc-example-content').addEventListener('click', function(event) {
  // Pastikan yang diklik adalah tombol "Copy"
  if (event.target.classList.contains('btn-clipboard')) {
      // Cek apakah opsi "With Customizer" sedang dipilih
      var withCustomizerSelected = document.getElementById('starter-template-customizer-tab').classList.contains('active');

      // Tentukan ID elemen <pre> yang akan disalin berdasarkan opsi yang dipilih
      var syntaxId = withCustomizerSelected ? 'syntax-with-customizer' : 'syntax-without-customizer';

      // Salin teks dari elemen <pre> yang sesuai
      copyText(syntaxId);
  }
});

document.addEventListener('DOMContentLoaded', function() {
  // Function to copy text to clipboard
  function copyToClipboard(text) {
    const textarea = document.createElement('textarea');
    textarea.value = text;
    document.body.appendChild(textarea);
    textarea.select();
    document.execCommand('copy');
    document.body.removeChild(textarea);
  }

  // Add event listener to the "Copy" button
  document.querySelector('.btn-clipboard').addEventListener('click', function() {
    const codeBlock = document.querySelector('.docs-code code');
    if (codeBlock) {
      copyToClipboard(codeBlock.innerText);
      this.setAttribute('data-bs-original-title', 'Copied!');
      const tooltip = bootstrap.Tooltip.getInstance(this);
      tooltip.show();

      // Reset tooltip title after a delay
      setTimeout(() => {
        this.setAttribute('data-bs-original-title', 'Copy to clipboard');
        tooltip.hide();
      }, 2000);
    }
  });
});




